import broadcaster from './broadcaster.js';

const BroadcasterPage = () => {
    return (
        <div>
            <p>broadcaster page</p>
            <video id="video" width="640" height="480" playsInline autoPlay muted></video>
            <div id="test"></div>
            <script type="module" src="broadcaster.js">
            </script>
        </div>

    )
}
export default BroadcasterPage;
